                var telemetryValues = {
                    ts: ts,
                    values: telemetryData
                };
                telemetry.push(telemetryValues);
                telemetryData = {};
            }
        }
        tagId = tagIdNext;
    }
    addToTelemetry(telemetry, telemetryData);
}

